.container {
    width: 100%; /* Full width */
    background-color: rgb(255, 255, 255); /* Grey background */
  }
  
  .skills {
    text-align: right; /* Right-align text */
    padding-top: 10px; /* Add top padding */
    padding-bottom: 10px; /* Add bottom padding */
    color: rgb(5, 5, 5); /* White text color */
  }
  
  .html {width: 75%; background-color: #4CAF50; animation: html 3s;} /* Green */
  .css {width: 69%; background-color: #4CAF50; animation: css 3s;} /* Blue */
  .py {width: 85%; background-color: #4CAF50; animation: py 3s;} /* Red */
  .java {width: 80%; background-color: #4CAF50; animation: java 3s;} /* Dark Grey */
  .ads {width: 85%; background-color: #4CAF50; animation: ads 3s;} /* Dark Grey */
@keyframes html{
    0%{
        width: 0%;
    }
    100%{
        width: 75%;
    }

}
@keyframes css{
    0%{
        width: 0%;
    }
    100%{
        width: 69%;
    }

}
@keyframes py{
    0%{
        width: 0%;
    }
    100%{
        width: 85%;
    }

}
@keyframes java{
    0%{
        width: 0%;
    }
    100%{
        width: 80%;
    }

}
@keyframes ads{
    0%{
        width: 0%;
    }
    100%{
        width: 85%;
    }

}
